import React , { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './Login.js'

import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Route exact path="/auth/" Component={Login}/>
      </div>
    </Router>
  );
}

export default App;
